import React, { useState, useEffect, useContext } from 'react';
import AuthContext from '../context/AuthContext';
import { getMisReservas } from '../services/reservasService';
import styles from './MisReservasPage.module.css';
import { Link } from 'react-router-dom';

const MisReservasPage = () => {
    const [reservas, setReservas] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');
    const { user } = useContext(AuthContext);

    useEffect(() => {
        const fetchReservas = async () => {
            if (!user) return;
            try {
                const response = await getMisReservas();
                setReservas(response.data);
            } catch (err) {
                setError('No se pudieron cargar tus reservas. Por favor, inténtalo de nuevo más tarde.');
            } finally {
                setLoading(false);
            }
        };

        fetchReservas();
    }, [user]);

    const formatDate = (dateString) => new Date(dateString).toLocaleDateString('es-CL');

    const renderContent = () => {
        if (loading) {
            return <p className={styles.centeredMessage}>Cargando tus reservas...</p>;
        }
        if (error) {
            return <p className={`${styles.centeredMessage} ${styles.errorMessage}`}>{error}</p>;
        }
        if (reservas.length === 0) {
            return (
                <div className={styles.noReservas}>
                    <h3>No tienes reservas aún</h3>
                    <p>Parece que todavía no has realizado ninguna reserva con nosotros.</p>
                    <Link to="/habitaciones" className="button">Explorar Habitaciones</Link>
                </div>
            );
        }
        return (
            <div className={styles.tableContainer}>
                <table>
                    <thead>
                        <tr>
                            <th>Nº Reserva</th>
                            <th>Hotel</th>
                            <th>Habitación</th>
                            <th>Check-in</th>
                            <th>Check-out</th>
                            <th>Costo Total</th>
                            <th>Estado</th>
                        </tr>
                    </thead>
                    <tbody>
                        {reservas.map((reserva) => (
                            <tr key={reserva._id}>
                                <td>{reserva.numeroReserva}</td>
                                <td>{reserva.hotel_id?.nombre || 'Hotel no especificado'}</td>
                                <td>{reserva.habitacion_id?.nombre || 'Habitación no especificada'}</td>
                                <td>{formatDate(reserva.fecha_inicio)}</td>
                                <td>{formatDate(reserva.fecha_fin)}</td>
                                <td>${(reserva.precio_final || 0).toLocaleString('es-CL')}</td>
                                <td>
                                    <span className={`${styles.status} ${styles[`status_${reserva.estado?.toLowerCase()}`]}`}>
                                        {reserva.estado}
                                    </span>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        );
    };

    return (
        <div className="container">
            <div className={styles.header}>
                <h1>Mis Reservas</h1>
                <p>Aquí puedes ver el historial completo de tus estadías con nosotros.</p>
            </div>
            {renderContent()}
        </div>
    );
};

export default MisReservasPage;
